package strings;

import java.util.HashMap;
import java.util.Map;

public class VerifyAnagram {
	public static boolean isAnagram(String s, String t) {
		if ((s == null && t != null) || (s != null && t == null))
			return false;
		int slength = s.length(), tlength = t.length();
		if (slength == tlength) {
			Map<Character, Integer> maps = new HashMap<>(), mapt = new HashMap<>();
			for (int i = 0; i < slength; i++) {
				char c = s.charAt(i);
				if (maps.containsKey(c))
					maps.replace(c, maps.get(c) + 1);
				else
					maps.put(c, 1);

				c = t.charAt(i);
				if (mapt.containsKey(c))
					mapt.replace(c, mapt.get(c) + 1);
				else
					mapt.put(c, 1);
			}

			for (int i = 0; i < slength; i++) {
				char c = s.charAt(i);
				if (maps.containsKey(c) && mapt.containsKey(c)) {
					if (maps.get(c) > 1 && mapt.get(c) > 1) {
						maps.replace(c, maps.get(c) - 1);
						mapt.replace(c, mapt.get(c) - 1);
					} else {
						maps.remove(c);
						mapt.remove(c);
					}
				} else
					return false;
			}

			return maps.size() == mapt.size() && mapt.size() == 0;

		} else
			return false;
	}

	public static boolean isAnagram2(String s, String t) {
		if ((s == null && t != null) || (s != null && t == null))
			return false;
		int slength = s.length(), tlength = t.length();
		if (slength == tlength) {
			Map<Character, Integer> maps = new HashMap<>(), mapt = new HashMap<>();
			for (int i = 0; i < slength; i++) {
				char c = s.charAt(i);
				if (maps.containsKey(c))
					maps.replace(c, maps.get(c) + 1);
				else
					maps.put(c, 1);

				c = t.charAt(i);
				if (mapt.containsKey(c))
					mapt.replace(c, mapt.get(c) + 1);
				else
					mapt.put(c, 1);
			}

			boolean isAnagram = true;
			for (Map.Entry<Character, Integer> entry : maps.entrySet()) {
				if (!maps.get(entry.getKey()).equals(mapt.get(entry.getKey())))
					isAnagram = false;
			}
			return isAnagram;

		} else
			return false;
	}

	public static void main(String[] args) {
		System.out.println(isAnagram2("anagram", "nagaram"));
		System.out.println(isAnagram2("aacc", "ccac"));
		System.out.println(isAnagram2(
				"",
				""));
	}
}
